script: |
  super -f text -I q12732.spq | sort > q12732.out

inputs:
  - name: q12732.spq
    data: |
      SELECT ALL col2 * col1 AS col2, + col2 * - CAST ( NULL AS INTEGER ) AS col1 FROM tab2 (FORMAT parquet) cor0 WHERE NOT + 35 < ( - col2 * - 79 * col1 + 41 );
  - name: tab2

outputs:
  - name: q12732.out
    data: |
